(function(window, undefined){

    // chess board implementation
    function CChessBoard(div_name)
    {
        this.name = div_name;                                           // parent div name
        this.fen = "rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR";       // fen record
        this.bordersize = 30;                                           // border in pixels

        // images
        this.images_type = {
            "b" : 0,
            "k" : 1,
            "n" : 2,
            "p" : 3,
            "q" : 4,
            "r" : 5,
            "B" : 6,
            "K" : 7,
            "N" : 8,
            "P" : 9,
            "Q" : 10,
            "R" : 11
        };

        this.images_src = [
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",
            "data:image/svg+xml;base64,",            "data:image/svg+xml;base64,"
        ];

        this.images = [];

        this.canvas = null;     // canvas in dom
        this.board = null;      // cached board

        this.track = "";        // type track figure
        this.trackX = 0;
        this.trackY = 0;

        this.loadedImagesCounter = 0;
        this.isInit = false;

        this.background             = "#EEEEEE";
        this.backgroundNewPanel     = "#888888";
        this.backgroundA1           = "#B58863";
        this.backgroundA2           = "#F0D9B5";

        this.positions = [];
        this.rectBoard = { x : 0, y : 0, w : 0, h : 0 };
        this.rectNewW = { x : 0, y : 0, w : 0, h : 0 };
        this.rectNewB = { x : 0, y : 0, w : 0, h : 0 };
    }

    CChessBoard.prototype =
    {
        init : function(fen)
        {
            if (fen && fen.length > 0)
                this.fen = fen;
            this.calculate_from_fen();

            var divElem = document.getElementById(this.name);
            this.canvas = document.createElement("canvas");
            divElem.appendChild(this.canvas);
            this.resize();

            var _this = this;
            var _onload = function()
            {
                _this.loadedImagesCounter++;
                if (12 == _this.loadedImagesCounter)
                {
                    // mozilla bug!!!
                    var _userAgent = navigator.userAgent.toLowerCase();
                    var isIE =  (_userAgent.indexOf("msie") > -1 ||
                                _userAgent.indexOf("trident") > -1 ||
                                _userAgent.indexOf("edge") > -1);

                    var isMozilla = !isIE && (_userAgent.indexOf("firefox") > -1);
                    if (isMozilla)
                    {
                        var _timerCount = 100;
                        var _timerIndex = 0;
                        var _timerId = setInterval(function(){

                            _timerIndex++;
                            var _allComplete = true;

                            var _board = window.g_board;
                            for (var ii = 0; ii < _board.images.length; ii++)
                            {
                                if (_board.images[ii].complete === false)
                                {
                                    _allComplete = false;
                                    break;
                                }
                            }

                            if (_allComplete || (_timerIndex > _timerCount))
                            {
                                clearInterval(_timerId);
                                setTimeout(function()
                                {
                                    _this.isInit = true;

                                    if (window.Asc.plugin.info.resize === true)
                                    {
                                        // simple resize ole object. close plugin
                                        return window.Asc.plugin.button(0);
                                    }

                                    _this.draw(true);
                                }, 0);
                            }

                        }, 10);
                        return;
                    }

                    setTimeout(function()
                    {
                        _this.isInit = true;

                        if (window.Asc.plugin.info.resize === true)
                        {
                            // simple resize ole object. close plugin
                            return window.Asc.plugin.button(0);
                        }

                        _this.draw(true);
                    }, 0);
                }
            };

            for (var i = 0; i < 12; i++)
            {
                this.images[i] = new Image();
                this.images[i].onload = _onload();
                this.images[i].src = this.images_src[i];
            }

            window.onresize = function(e) { _this.resize(); };
            this.canvas.onmousedown = function(e) { _this.onmousedown(e); };
            this.canvas.onmousemove = function(e) { _this.onmousemove(e); };
            this.canvas.onmouseup = function(e) { _this.onmouseup(e); };
        },

        resize : function()
        {
            if (!this.canvas)
                return;

            var browser_w = Math.max(document.documentElement.clientWidth, window.innerWidth || 0);
            var browser_h = Math.max(document.documentElement.clientHeight, window.innerHeight || 0);

            this.canvas.style.width = browser_w + "px";
            this.canvas.style.height = browser_h + "px";

            this.canvas.width = (window.devicePixelRatio * parseInt(this.canvas.style.width)) >> 0;
            this.canvas.height = (window.devicePixelRatio * parseInt(this.canvas.style.height)) >> 0;

            if (!this.board)
                this.board = document.createElement("canvas");

            this.board.width = this.canvas.width;
            this.board.height = this.canvas.height;

            var width = this.canvas.width;
            var height = this.canvas.height;

            this.bordersize = Math.min(30, (Math.min(width, height) / 10) >> 0);

            // calculate places
            var _size_square1 = (width - 4 * this.bordersize) / 10;
            var _size_square2 = (height - 2 * this.bordersize) / 8;
            var _size_square = Math.min(_size_square1, _size_square2) >> 0;

            this.rectBoard.y = (height - (8 * _size_square)) >> 1;
            this.rectBoard.height = 8 * _size_square;
            this.rectBoard.width = 8 * _size_square;

            this.rectNewW.x = (width - (10 * _size_square) - 2 * this.bordersize) >> 1;
            this.rectNewW.y = this.rectBoard.y + _size_square;
            this.rectNewW.width = _size_square;
            this.rectNewW.height = 6 * _size_square;

            this.rectBoard.x = this.rectNewW.x + _size_square + this.bordersize;

            this.rectNewB.x = this.rectBoard.x + this.rectBoard.width + this.bordersize;
            this.rectNewB.y = this.rectNewW.y;
            this.rectNewB.width = _size_square;
            this.rectNewB.height = 6 * _size_square;

            this.draw(true);
        },

        draw : function(updateBoard)
        {
            if (!this.isInit)
                return;

            if (updateBoard)
                this.drawBoard();

            var ctx = this.canvas.getContext('2d');
            ctx.drawImage(this.board, 0, 0);

            // track
            if (this.track != "")
            {
                var _size_square = this.rectNewW.width;
                ctx.drawImage(this.images[this.images_type[this.track]],
                    this.trackX - (_size_square >> 1), this.trackY - (_size_square >> 1), _size_square, _size_square);
            }
        },

        drawBoard : function()
        {
            var ctx = this.board.getContext('2d');
            ctx.fillStyle = this.background;
            ctx.fillRect(0, 0, this.board.width, this.board.height);

            ctx.fillStyle = this.backgroundNewPanel;
            ctx.fillRect(this.rectNewW.x, this.rectNewW.y, this.rectNewW.width, this.rectNewW.height);
            ctx.fillRect(this.rectNewB.x, this.rectNewB.y, this.rectNewB.width, this.rectNewB.height);

            ctx.fillStyle = this.backgroundA1;
            ctx.fillRect(this.rectBoard.x, this.rectBoard.y, this.rectBoard.width, this.rectBoard.height);

            ctx.fillStyle = this.backgroundA2;
            ctx.beginPath();
            var _size_square = this.rectNewW.width;
            var _x = this.rectBoard.x;
            var y = 0;
            var x = 0;
            var i;
            var j;
            for (i = 0; i < 8; i++)
            {
                y = this.rectBoard.y + i * _size_square;
                x = _x;
                if (i & 1)
                    x += _size_square;

                for (var j = 0; j < 4; j++)
                {
                    ctx.moveTo(x, y);
                    ctx.lineTo(x + _size_square, y);
                    ctx.lineTo(x + _size_square, y + _size_square);
                    ctx.lineTo(x, y + _size_square);
                    ctx.closePath();
                    x += (2 * _size_square);
                }
            }
            ctx.fill();
            ctx.beginPath();

            // draw new figures
            var _kind = ["k", "q", "r", "b", "n", "p"];
            x = this.rectNewW.x;
            y = this.rectNewW.y;
            for (i = 0; i < 6; i++, y += _size_square)
            {
                ctx.drawImage(this.images[this.images_type[_kind[i].toUpperCase()]], x, y, _size_square, _size_square);
            }

            x = this.rectNewB.x;
            y = this.rectNewB.y;
            for (i = 0; i < 6; i++, y += _size_square)
            {
                ctx.drawImage(this.images[this.images_type[_kind[i]]], x, y, _size_square, _size_square);
            }

            // draw figures
            y = this.rectBoard.y;
            for (i = 0; i < 8; i++, y += _size_square)
            {
                x = this.rectBoard.x;
                for (j = 0; j < 8; j++, x += _size_square)
                {
                    var _type = this.positions[i][j];
                    if (_type.length == 1)
                        ctx.drawImage(this.images[this.images_type[_type]], x, y, _size_square, _size_square);
                }
            }
        },

        getResult : function(width, height)
        {
            if (!width)
                width = 200;
            if (!height)
                height = 200;

            var canvas = document.createElement("canvas");
            canvas.width = width;
            canvas.height = height;

            var ctx = canvas.getContext("2d");

            var _size = Math.min(width, height);
            var _size_square = _size >> 3;

            var _x = (width - 8 * _size_square) >> 1;
            var _y = (height - 8 * _size_square) >> 1;

            var x, y, i, j;

            ctx.fillStyle = this.backgroundA1;
            ctx.fillRect(_x, _y, 8 * _size_square, 8 * _size_square);

            ctx.fillStyle = this.backgroundA2;
            ctx.beginPath();
            for (i = 0; i < 8; i++)
            {
                y = _y + i * _size_square;
                x = _x;
                if (i & 1)
                    x += _size_square;

                for (var j = 0; j < 4; j++)
                {
                    ctx.moveTo(x, y);
                    ctx.lineTo(x + _size_square, y);
                    ctx.lineTo(x + _size_square, y + _size_square);
                    ctx.lineTo(x, y + _size_square);
                    ctx.closePath();
                    x += (2 * _size_square);
                }
            }
            ctx.fill();
            ctx.beginPath();

            y = _y;
            for (i = 0; i < 8; i++, y += _size_square)
            {
                x = _x;
                for (var j = 0; j < 8; j++, x += _size_square)
                {
                    var _type = this.positions[i][j];
                    if (_type.length == 1)
                        ctx.drawImage(this.images[this.images_type[_type]], x, y, _size_square, _size_square);
                }
            }

            return { image: canvas.toDataURL("image/png"), data: this.fen };
        },

		getData: function()
		{
			return this.fen;
		},
	    calculate_to_fen : function()
        {
            this.fen = "";
            for (var i = 0; i < 8; i++)
            {
                var _line = "";

                var _number = 0;
                var _line_pos = this.positions[i];

                for (var j = 0; j < 8; j++)
                {
                    if (_line_pos[j] == "")
                    {
                        _number++;
                        if (7 == j)
                            _line += _number;
                    }
                    else
                    {
                        if (_number != 0)
                        {
                            _line += _number;
                            _number = 0;
                        }
                        _line += _line_pos[j];
                    }
                }

                this.fen += _line;
                if (7 != i)
                    this.fen += "/";
            }
        },

        calculate_from_fen : function()
        {
            var _lines = this.fen.split("/");
            if (8 != _lines.length)
            {
                this.fen = "rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR";
                _lines = this.fen.split("/");
            }

            for (var i = 0; i < 8; i++)
            {
                var _line = _lines[i];
                var _position = ["", "", "", "", "", "", "", ""];
                var _cur = 0;

                var _len = _line.length;
                for (var j = 0; j < _len; j++)
                {
                    var _c = _line[j];
                    if (this.images_type[_c] != undefined)
                    {
                        _position[_cur++] = _c;
                    }
                    else
                    {
                        var _skip = _c.charCodeAt(0) - "0".charCodeAt(0);
                        if (_skip >= 0 && _skip <= 8)
                            _cur += _skip;
                        else
                            break;

                        if (_cur > 7)
                            break;
                    }
                }

                this.positions[i] = _position;
            }
        },

        getPosition: function(x, y)
        {
            var _kind = ["k", "q", "r", "b", "n", "p"];
            var _size_square = this.rectNewB.width;
            if ((x > this.rectNewW.x) && (x < this.rectNewW.x + this.rectNewW.width) &&
                (y > this.rectNewW.y) && (y < this.rectNewW.y + this.rectNewW.height))
            {
                return { type: "w", value: _kind[((y - this.rectNewW.y) / _size_square) >> 0].toUpperCase() };
            }
            if ((x > this.rectNewB.x) && (x < this.rectNewB.x + this.rectNewB.width) &&
                (y > this.rectNewB.y) && (y < this.rectNewB.y + this.rectNewB.height))
            {
                return { type: "b", value: _kind[((y - this.rectNewB.y) / _size_square) >> 0] };
            }
            if ((x > this.rectBoard.x) && (x < this.rectBoard.x + this.rectBoard.width) &&
                (y > this.rectBoard.y) && (y < this.rectBoard.y + this.rectBoard.height))
            {
                var _ret = { type: "board", value: "", x: 0, y: 0 };
                _ret.x = ((x - this.rectBoard.x) / _size_square) >> 0;
                _ret.y = ((y - this.rectBoard.y) / _size_square) >> 0;
                _ret.value = this.positions[_ret.y][_ret.x];

                return _ret;
            }
            return null;
        },

        onmousedown : function(e)
        {
            var mouseX = (e.pageX !== undefined) ? e.pageX : e.clientX;
            var mouseY = (e.pageY !== undefined) ? e.pageY : e.clientY;
            mouseX *= window.devicePixelRatio;
            mouseY *= window.devicePixelRatio;

            var _pos = this.getPosition(mouseX, mouseY);
            this.trackX = mouseX;
            this.trackY = mouseY;
            if (!_pos)
            {
                this.track = "";
                if (e.preventDefault)
                    e.preventDefault();
                return false;
            }

            if (_pos.type == "w" || _pos.type == "b")
            {
                this.track = _pos.value;
                this.draw(false);
            }
            else if (_pos.value != "")
            {
                this.track = _pos.value;
                this.positions[_pos.y][_pos.x] = "";
                this.draw(true);
            }
            else
            {
                this.track = "";
            }

            if (e.preventDefault)
                e.preventDefault();
            return false;
        },
        onmousemove : function(e)
        {
            var mouseX = (e.pageX !== undefined) ? e.pageX : e.clientX;
            var mouseY = (e.pageY !== undefined) ? e.pageY : e.clientY;
            mouseX *= window.devicePixelRatio;
            mouseY *= window.devicePixelRatio;

            if (this.track != "")
            {
                this.trackX = mouseX;
                this.trackY = mouseY;
                this.draw(false);
            }

            if (e.preventDefault)
                e.preventDefault();
            return false;
        },
        onmouseup : function(e)
        {
            var mouseX = this.trackX;
            var mouseY = this.trackY;

            if (e)
            {
                mouseX = (e.pageX !== undefined) ? e.pageX : e.clientX;
                mouseY = (e.pageY !== undefined) ? e.pageY : e.clientY;
                mouseX *= window.devicePixelRatio;
                mouseY *= window.devicePixelRatio;
            }

            if (this.track != "")
            {
                var _pos = this.getPosition(mouseX, mouseY);
                if (_pos && _pos.type == "board")
                {
                    this.positions[_pos.y][_pos.x] = this.track;
                    this.track = "";
                    this.draw(true);
                }
                else
                {
                    this.track = "";
                    this.draw(false);
                }
                this.calculate_to_fen();
            }

            if (e && e.preventDefault)
                e.preventDefault();
            return false;
        }
    };

    window.g_board = new CChessBoard("chess");

    window.Asc.plugin.init = function(text)
    {
        window.g_board.init(text);
    };

    window.Asc.plugin.button = function(id)
    {
        if (id == 0)
        {
            var _info = window.Asc.plugin.info;

            var _method = (_info.objectId === undefined) ? "AddOleObject" : "EditOleObject";
			
            _info.width = _info.width ? _info.width : 70;
            _info.height = _info.height ? _info.height : 70;
			_info.widthPix = (_info.mmToPx * _info.width) >> 0;
			_info.heightPix = (_info.mmToPx * _info.height) >> 0;
			
			var _param = {
				guid : _info.guid,
				widthPix : _info.widthPix,
				heightPix : _info.heightPix,
				width : _info.width,
				height : _info.height,
				imgSrc : window.g_board.getResult(_info.widthPix, _info.heightPix).image,
				data : window.g_board.getData(),
				objectId : _info.objectId,
				resize : _info.resize
			};

			window.Asc.plugin.executeMethod(_method, [_param], function() {
				window.Asc.plugin.executeCommand("close", "");
			});
        }
        else
        {
            this.executeCommand("close", "");
        }
    };

    window.Asc.plugin.onExternalMouseUp = function()
    {
        if (window.g_board.track != "")
            window.g_board.onmouseup(null);
    };

})(window, undefined);
